import React, {Component} from "react";
import styled from "styled-components";
import Headerbar from "../ui/Headerbar";
import {Box, Tab, Tabs} from '@mui/material';
import { TabPanel } from '@mui/lab';

function a11yProps(index) {
    return {
      id: `simple-tab-${index}`,
      'aria-controls': `simple-tabpanel-${index}`,
    };
}


export default class DashboardContent extends Component{
    constructor(props){
        super(props)

        this.state = {
                    value: 1, 
                    index: 0}}

    handleChange(number){
        console.log(number)
        this.setState({value: number});
    };

    render(){
        return (
            <Content className="dashboard-content">
                <Headerbar></Headerbar>
                <Box sx={{ borderBottom: 1, borderColor: 'divider' }}>
                    <Tabs value={this.value} onChange={this.handleChange} aria-label="basic tabs example">
                        <Tab label="Item One" {...a11yProps(0)} />
                        <Tab label="Item Two" {...a11yProps(1)} />
                        <Tab label="Item Three" {...a11yProps(2)} />
                    </Tabs>
                </Box>

                <TabPanel value={this.value} index={0}>
                    Item One
                </TabPanel>
                <TabPanel value={this.value} index={1}>
                    Item Two
                </TabPanel>
                <TabPanel value={this.value} index={2}>
                    Item Three
                </TabPanel>
            </Content>
        )
    }

}

const Content = styled.div`
    min-height: 50%;
    height:100%;
    width: 100%;
    background-color: #19324b;
`
